Define annotation @Constraint(validatedBy = [UenValidator::class])
@Target(AnnotationTarget.FUNCTION, AnnotationTarget.CLASS)
@Retention(AnnotationRetention.RUNTIME)
annotation class UenConstraint( val message: String = "UEN should not be null for login type CorpPass", val groups: Array<KClass<*>> = [], val payload: Array<KClass<out Payload>> = [],
) Define the validator using ConstraintValidator class UenValidator : ConstraintValidator<UenConstraint, ApplicationRequest> { override fun isValid( request: ApplicationRequest, cxt: ConstraintValidatorContext?, ): Boolean { if (request.loginType != LoginType.CORPPASS) { return true } if (request.uen == null) { return false } return request.uen.isNotBlank() }
} Usage @UenConstraint
data class ApplicationRequest( val loginType: LoginType?, val uinfin: String?, val uen: String?,
) Reference: Spring Java Bean Validation

